<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Superform Airdrop Checker</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen, Ubuntu, Cantarell, sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            display: flex;
            align-items: center;
            justify-content: center;
            padding: 20px;
        }

        .container {
            background: white;
            border-radius: 20px;
            padding: 40px;
            max-width: 600px;
            width: 100%;
            box-shadow: 0 20px 60px rgba(0, 0, 0, 0.3);
        }

        h1 {
            color: #333;
            margin-bottom: 10px;
            font-size: 28px;
        }

        .subtitle {
            color: #666;
            margin-bottom: 30px;
            font-size: 14px;
        }

        input {
            width: 100%;
            padding: 16px 20px;
            border: 2px solid #e0e0e0;
            border-radius: 12px;
            font-size: 16px;
            transition: all 0.3s;
            font-family: 'Courier New', monospace;
            margin-bottom: 20px;
        }

        input:focus {
            outline: none;
            border-color: #667eea;
            box-shadow: 0 0 0 3px rgba(102, 126, 234, 0.1);
        }

        .btn {
            width: 100%;
            padding: 16px;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            border: none;
            border-radius: 12px;
            font-size: 16px;
            font-weight: 600;
            cursor: pointer;
            transition: transform 0.2s;
        }

        .btn:hover {
            transform: translateY(-2px);
            box-shadow: 0 10px 20px rgba(102, 126, 234, 0.3);
        }

        .result {
            margin-top: 30px;
            padding: 25px;
            border-radius: 12px;
            display: none;
        }

        .result.success {
            background: #f0fdf4;
            border: 2px solid #86efac;
            display: block;
        }

        .result.error {
            background: #fef2f2;
            border: 2px solid #fca5a5;
            display: block;
        }

        .result-label {
            font-size: 12px;
            color: #666;
            text-transform: uppercase;
            letter-spacing: 1px;
            margin-bottom: 8px;
        }

        .result-value {
            font-size: 36px;
            font-weight: bold;
            color: #16a34a;
        }

        .result.error .result-value {
            color: #dc2626;
            font-size: 18px;
        }

        .wallet-address {
            font-size: 13px;
            color: #666;
            margin-top: 10px;
            font-family: 'Courier New', monospace;
            word-break: break-all;
        }

        .stats {
            display: grid;
            grid-template-columns: 1fr 1fr;
            gap: 15px;
            margin-top: 20px;
            padding-top: 20px;
            border-top: 1px solid #e0e0e0;
        }

        .stat {
            text-align: center;
        }

        .stat-value {
            font-size: 20px;
            font-weight: bold;
            color: #333;
        }

        .stat-label {
            font-size: 12px;
            color: #666;
            margin-top: 5px;
        }
    </style>
</head>

        function checkAirdrop() {
            const input = document.getElementById('walletInput');
            const result = document.getElementById('result');
            let address = input.value.trim();

            if (!address) {
                showError('Please enter a wallet address');
                return;
            }

            if (!address.startsWith('0x') || address.length !== 42) {
                showError('Please enter a valid Ethereum address');
                return;
            }

            // Try exact match first
            let allocation = airdropData[address];
            
            // If not found, try case-insensitive search
            if (allocation === undefined) {
                const foundKey = Object.keys(airdropData).find(k => k.toLowerCase() === address.toLowerCase());
                if (foundKey) {
                    allocation = airdropData[foundKey];
                    address = foundKey;
                }
            }

            if (allocation !== undefined) {
                showSuccess(parseFloat(allocation), address);
            } else {
                showError('Wallet address not found in airdrop list');
            }
        }

        function showSuccess(amount, address) {
            const result = document.getElementById('result');
            result.className = 'result success';
            result.innerHTML = `
                <div class="result-label">Your Allocation</div>
                <div class="result-value">${amount.toLocaleString()} $UP</div>
                <div class="wallet-address">${address}</div>
            `;
        }

        function showError(message) {
            const result = document.getElementById('result');
            result.className = 'result error';
            result.innerHTML = `
                <div class="result-label">Error</div>
                <div class="result-value">${message}</div>
            `;
        }

        document.getElementById('walletInput').addEventListener('keypress', function(e) {
            if (e.key === 'Enter') {
                checkAirdrop();
            }
        });
    </script>
